import React, { useState } from 'react';
import { Briefcase, Users, Bolt, Banknote, Heart, Book, Laptop, Leaf, ShoppingCart, DollarSign, Home } from "lucide-react";

const Sectors = () => {
  const [showMore, setShowMore] = useState(false);

  // Sector data with Lucide React icons
  const sectorsData = [
    { title: 'MSME / SME', icon: <Briefcase size={32} className="text-primary" /> },
    { title: 'Skill and Women Empowerment', icon: <Users size={32} className="text-secondary" /> },
    { title: 'Clean Energy and Climate Change', icon: <Bolt size={32} className="text-primary" /> },
    { title: 'Banking and Capital Markets', icon: <Banknote size={32} className="text-secondary" /> },
    { title: 'Healthcare & Medicine', icon: <Heart size={32} className="text-primary" /> },
    { title: 'Education & Learning', icon: <Book size={32} className="text-secondary" /> },
    { title: 'Technology & Innovation', icon: <Laptop size={32} className="text-primary" /> },
    { title: 'Tourism & Hospitality', icon: <Laptop size={32} className="text-secondary" /> },
    { title: 'Agriculture & Food', icon: <Leaf size={32} className="text-primary" /> },
    { title: 'Retail & E-commerce', icon: <ShoppingCart size={32} className="text-secondary" /> },
    { title: 'Finance & Investment', icon: <DollarSign size={32} className="text-primary" /> },
    { title: 'Real Estate & Infrastructure', icon: <Home size={32} className="text-secondary" /> },
  ];

  return (
    <div id="sectors" className="sectors-section">
      <style>
        {`
          .sectors-section {
            padding: 80px 110px;
            background: linear-gradient(to center, #fff4e5, #fff, #e0f7fa);
          }

          .section-title {
            text-align: center;
            margin-bottom: 64px;
          }

          .highlighted-title {
            font-size: 2.5rem;
            color: #FF7043;
            font-weight: bold;
          }

          .section-description {
            margin-top: 16px;
            font-size: 1.25rem;
            color: #4B5563;
          }

          .sectors-grid {
            display: grid;
            grid-template-columns: repeat(4, 1fr); 
            gap: 42px;
            justify-items: center;
          }

          .sector-card {
            width: 100%;
            max-width: 250px;
          }

          .sector-card-inner {
            padding: 24px;
            background-color: rgba(255, 255, 255, 0.5);
            backdrop-filter: blur(10px);
            border-radius: 12px;
            transition: all 0.3s ease;
            cursor: pointer;
          }

          .sector-card-inner:hover {
            box-shadow: 0px 4px 12px rgba(0, 0, 0, 0.2);
            transform: translateY(-8px);
          }

          .icon-wrapper {
            margin-bottom: 16px;
            transition: transform 0.3s ease;
          }

          .icon-wrapper:hover {
            transform: scale(1.1);
          }

          .sector-title {
            font-size: 1.25rem;
            font-weight: 600;
            color: #1F2937;
            margin-bottom: 8px;
          }

          .view-more-button {
            padding: 12px 24px;
            background-color: #FF5722;
            color: white;
            border-radius: 8px;
            transition: background-color 0.3s ease;
          }

          .view-more-button:hover {
            background-color: #e64a19;
          }

          .text-primary {
            color: #FF7043;
          }

          .text-secondary {
            color: #4CAF50;
          }
        `}
      </style>

      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="text-center mb-16">
          <h2 className="section-title">
            <span className="highlighted-title">Our Sectors</span>
          </h2>
          <p className="section-description">
            AIFBF supports various sectors that significantly contribute to India's GDP
          </p>
        </div>

        <div className="sectors-grid">
          {sectorsData.slice(0, showMore ? sectorsData.length : 4).map((sector, index) => (
            <div className="sector-card" key={index}>
              <div className="sector-card-inner">
                <div className="icon-wrapper">
                  {sector.icon}
                </div>
                <h3 className="sector-title">{sector.title}</h3>
              </div>
            </div>
          ))}
        </div>

        <div className="text-center mt-6">
          <button onClick={() => setShowMore(!showMore)} className="view-more-button">
            {showMore ? 'View Less' : 'View More Sectors'}
          </button>
        </div>
      </div>
    </div>
  );
};

export default Sectors;
